import React, { useState } from "react";
import styles from "./SideBarLibrary.module.css";
import ChipList from "../ChipList/ChipList";
import DropDown from "../DropDown/DropDown";
import ArtistCard from "../ArtistCard/ArtistCard";
import artistLogo1 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo2 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo3 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo4 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo5 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo6 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo7 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo8 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo9 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo10 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo11 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo12 from "../../Assets/Images/artist_Logo.jpeg";
import artistLogo13 from "../../Assets/Images/artist_Logo.jpeg";

const SideBarLibrary = () => {
  const [chipData, setChipData] = useState([
    "Playlists",
    "Artist",
    "Albums",
    "Podcast...",
  ]);

  const [artistData, setArtistData] = useState([
    {
      imageUrl: "artistLogo1",
      artistName: "",
    },
    {
      imageUrl: "artistLogo2",
      artistName: "",
    },
    {
      imageUrl: "artistLogo13",
      artistName: "",
    },
    {
      imageUrl: "artistLogo4",
      artistName: "",
    },
    {
      imageUrl: "artistLogo5",
      artistName: "",
    },
    {
      imageUrl: "artistLogo6",
      artistName: "",
    },
    {
      imageUrl: "artistLogo7",
      artistName: "",
    },
    {
      imageUrl: "artistLogo8",
      artistName: "",
    },
    {
      imageUrl: "artistLogo9",
      artistName: "",
    },
    {
      imageUrl: "artistLogo10",
      artistName: "",
    },
    {
      imageUrl: "artistLogo11",
      artistName: "",
    },
    {
      imageUrl: "artistLogo12",
      artistName: "",
    },
    {
      imageUrl: "artistLogo13",
      artistName: "",
    },
  ]);

  return (
    <div className={styles.sideBarLibrary}>
      <div className={styles.sideBarContent}>
        <div className={styles.yourLibrary}>
          <img
            className={styles.sideBarIcon}
            src={require("../../Assets/Icons/library_Icon.png")}
            alt=""
          />
          <span className={styles.SideBarYourLibrary}>Your Library</span>
          <div className={styles.playlistCreateButton}>
            <img src={require("../../Assets/Icons/plus_Icon.png")} alt="" />
            <img src={require("../../Assets/Icons/arrow_Icon.png")} alt="" />
          </div>
        </div>
        <div className={styles.chipList}>
          <ChipList chipData={chipData} />
          {/* <img
            className={styles.rightArrowIcon}
            src={require("../../Assets/Icons/right_Arrow_Icon.png")}
            alt=""
          /> */}
        </div>
        <div className={styles.searchInLibrary}>
          <img src={require("../../Assets/Icons/seacrh_Icon.png")} alt="" />
          <div className={styles.dropDown}>
            <DropDown dropDownTitle="Recents" />
          </div>
        </div>
        <div className={styles.artistCard}>
          <ArtistCard />
        </div>
      </div>
    </div>
  );
};

export default SideBarLibrary;
